    "headlineNews": "Kyler Murray completed 23-of-41 attempts for 257 yards, a touchdown, and an interception in the Cardinals' Week 15 loss to the Lions, adding four rushes for three yards.\u00a0\n",
    "report": "",
    "analysis": "Murray and the Cardinals were asleep throughout their humiliating loss to the Lions, out-hustled and outplayed throughout. Murray was yanked in the blowout loss with four minutes to go in the fourth quarter. Under duress from start to finish against a middling Detroit front seven, Murray missed a handful of makable throws. The Cardinals drove deep into Detroit territory a few times in the first half and came away with a single field goal. Murray avoided taking off from the pocket time and again, instead scrambling behind the line of scrimmage and hoping Arizona wideouts could get open. They did not. Murray, after a red-hot start to 2021, has accounted for one touchdown over the team's past two games and has multiple touchdown passes in just one of his past four outings. Hopefully he can get it together next week against the Colts, though it might not matter for Kyler drafters who were likely done in by their QB's lackluster Week 15 performance.\u00a0\n",
