    "headlineNews": "Patrick Mahomes completed 31-of-47 passes for 410 yards, three touchdowns and an interception in the Chiefs' 34-28, Week 15 overtime win over the Chargers, adding three carries for 32 additional yards.\u00a0\n",
    "report": "",
    "analysis": "The seventh 400-yard game of Mahomes' career was his second of the season, with this one representing his new 2021 high-water mark. Mahomes relied on his old faithfuls of Tyreek Hill and Travis Kelce, finding his top-two weapons for an otherworldly 22/339/3. That included some jaw-dropping after-the-catch work from Kelce and hard-to-believe grabs from Hill. They bailed out their quarterback on a night where he made some seriously shaky throws, none shakier than his interception to LB Uchenna Nwosu inside his own 10-yard line in the fourth quarter. Mahomes also turf missiled a walk-in touchdown to Mecole Hardman on a third quarter fourth down from the Chargers' two. That is to say nothing of the open pass catchers Mahomes was missing all night. It was after those second half mistakes, however, that Mahomes seemed to find himself, making huge plays with his legs and stick 'em throws with his arm. He now heads into a fantasy semifinals matchup with a collapsing Steelers defense, though Pittsburgh's struggles are particularly acute on the ground.\u00a0\n",
