    "headlineNews": "Derek Carr completed 25-of-38 passes for 236 yards, one touchdown, and one interception in the Raiders' 16-14, Week 15 win over the Browns.\n",
    "report": "",
    "analysis": "Carr looked to have sealed his team's fate for this game and their dwindling playoff dreams with an interception late in the fourth quarter. He was looking to hit Zay Jones on a deep shot but ultimately overthrew his receiver. Luckily for Carr, his defense got him the ball back with two minutes left and he marched the offense down the field, putting Daniel Carlson in position to net a game-winner. It wasn't Carr's greatest performance but his fourth-quarter drive was nothing but clutch. The Browns also did a good job of taking Hunter Renfrow away, forcing him to rely on Zay Jones and Foster Moreau. It was an ugly win versus a COVID-depleted Cleveland squad but Carr managed to keep his team in the playoff hunt. He projects as a middling-QB2 option versus a stingy Denver defense next week.\n",
