    "analysis": "Hughes is objectively correct. The Jets have averaged 1.35 points per drive with Wilson under center and 2.19 points per drive with anyone else at the helm. Joe Flacco, for one, is a far superior option to Wilson, whose dismal play crushes fantasy value for everyone in the Jets offense. Hughes pointed out that Jets coaches said Wilson would be rejuvenated after a lengthy absence with a knee injury; he's been as bad or worse since returning to the lineup. Only Davis Mills has a worse Pro Football Focus passing grade than Wilson through Week 15. Hughes said Wilson's play over the season's final three games will prove crucial in luring free agents to the Jets this offseason. More disastrous play from Wilson could make the team a no-go for 2022 free agents.\u00a0\n",
