    "headlineNews": "Josh Allen completed 19-of-34 passes for 210 yards, three touchdowns, and one interception in the Bills' 31-14, Week 15 win over the Panthers, adding three carries for 24 yards.\n",
    "report": "",
    "analysis": "It wasn't the most high-octane performance from the Bills offense. Allen handed the ball off 23 times and seemed less inclined to rush the ball himself. The Bills even ran an Isaiah McKenzie wildcat play, which may have been a designed rush for Allen if the quarterback was dealing with a foot sprain. Allen looked good when dropping back. He hit Stefon Diggs for an 11 yard TD on play action. He then connected twice with Gabriel Davis, first in the back for the end zone on a beautiful 20-yard throw. He then found Davis wide open on a 4th-and-3 play action, which iced the game. Allen's interception game on a heady play by Jeremy Chin, who baited Allen into a throw to Diggs in zone coverage. Overall, it was a strong game from Allen, who was held back more by the Bills' playcalling than the Panthers' defense. He will be a locked-in QB1 in Week 16's rematch with the Patriots.\n",
