    "analysis": "Facing a bottom-two run defense on paper that has nevertheless been stiffening in recent weeks, CEH was held to 50 yards or fewer for the second consecutive game. Not counting his fourth quarter two-point conversion, CEH was also held without a goal-line or red zone touch as Darrel Williams and FB Michael Burton both handled two. He was the intended target on Patrick Mahomes' interception inside the 10-yard line, but the mistake was entirely the quarterback's. CEH's workloads have shrunk in back-to-back contests, and he is averaging just 14 touches in four games since returning from injury. All that being said, he will remain in the RB2 mix for Week 16 because the Chiefs will be facing a Steelers run defense in absolute free fall. Just consider him more of a floor than ceiling play.\u00a0\n",
