    "headlineNews": "Dolphins co-offensive coordinator Eric Studesville said the team will continue with a running back competition in Week 16.\u00a0\n",
    "report": "",
    "analysis": "\"All those guys are going to play and participate in the game plan,\" Studesville said when asked about the team's game plan headed into Week 16 against the Saints. It's not exactly a surprise after Duke Johnson came off the team's practice squad and had the game of his pro career against the Jets in Week 15, rushing for 107 yard and two touchdowns in the Dolphins' victory. CBS commentators said during the Dolphins-Jets game that Miami coaches weren't sure Myles Gaskin could handle a full workload after coming off the COVID-19 list 24 hours before game time. Maybe we'll see his reps increase in Week 16 after seeing ten carries to Johnson's 22 attempts against New York. Both Miami backs are borderline flex options against the Saints since neither of them is likely to serve as a workhorse.\u00a0\n",
