    "report": "",
    "analysis": "Diggs was on the receiving end of Josh Allen's first touchdown of the day but had a quiet day overall. Diggs was also the target on Allen's only interception, but there was no error on Diggs' part. Diggs had a couple of opportunities for a bigger day. He ran a nice double move in single coverage in the red zone but was defended well and Allen didn't make the throw. He also got wide open in the 4th quarter but Allen took too long to find him and he was pushed out of bounds. Even with a few missed opportunities, Diggs wasn't set up for a huge day. The Bills played things more conservatively than usual against the Cam Newton-led Panthers. Hopefully, the Patriots can push the Bills a bit more in Week 16. Diggs remains a WR1.\u00a0\n",
