    "headlineNews": "Mike Williams caught 3-of-9 targets for 49 yards in the Chargers' Week 15 overtime loss to the Chiefs.\u00a0\n",
    "report": "",
    "analysis": "It was a bitterly disappointing evening for Williams, who failed to convert likely touchdowns on back-to-back plays from the Chiefs' five-yard line on the Chargers' opening drive. The first was a flat drop in the end zone. For the second, Williams got blown up right at the goal line and dropped the pass, injuring his right shoulder in the process. Williams remained down for several moments before making his way to the sideline. His arm was dangling at his side, but he ended up barely missing any time. Williams heads into an A+ Week 16 matchup with the Texans having cleared 100 yards just once in his past nine appearances. He has also found the end zone only one time in that timespan. The matchup is right, but Williams should be treated as a low-end WR2.\u00a0\n",
