    "headlineNews": "DeVante Parker caught 4-of-8 targets for 68 yards and a touchdown in the Dolphins' Week 15 win over the Jets.\u00a0\n",
    "report": "",
    "analysis": "The score was his first since Week 4. Parker also drew an end zone DPI to set the Dolphins up at the Jets' one at the 14:32 mark of the fourth quarter. One of Parker's missed connections was an end zone look, while he was wide open for a different painted area target where Tua Tagovailoa simply missed him, throwing to an enveloped Mike Gesicki instead. Parker nevertheless made fantasy managers' day with an 11-yard, game-winning score with 3:37 remaining, dusting Bryce Hall 1-on-1 near the goal line. With Jaylen Waddle (COVID-19) likely back for Week 16 vs. the Saints, Parker will return to being more of a WR3 than WR2, but he will be a legitimate option for the second round of the fantasy playoffs.\u00a0\n",
