    "headlineNews": "Vikings signed Memphis K Riley Patterson.\n",
    "report": "",
    "analysis": "Patterson (5\u201910/181) was a three-star prospect that was rated as the 16th best kicker from the 2017 prep class. The Edwardsville, IL native struggled a bit as a freshman, converting 69 percent of his field goals while registering only two touchbacks on 24 kickoffs. However, Patterson showed consistent year-over-year improvement throughout his career, boosting his conversion rate to 75 percent in 2018 and 92 percent in 2019. In addition to his on-point accuracy, Patterson converted five-of-six attempts of 50 or more yards two seasons ago. His production slipped a bit in 2020, making 15-of-22 attempts, but five of those misses came from beyond the 50-yard threshold, so that should be accounted for. Though he doesn\u2019t possess the most imposing leg in the class, his touchback rate was decent, as 38-of-63 kickoffs were not returned. He will need to iron out his conversion rate if he is going to stick around at the NFL level. The Vikings only have one other kicker rostered, third-year boot Greg Joseph, who has just 20 career field goal attempts. Expect a true kicking completion to take place between Joseph and Patterson if the Vikings don't bring in anyone else.\n",
